import React, { useState, useEffect, useRef } from 'react';
import { useHealth } from '../../context/HealthContext';
import { Search as SearchIcon, Calendar, Pill, Activity } from 'lucide-react';

const SearchResult = ({ result, onSelect }) => {
  const getIcon = () => {
    switch (result.type) {
      case 'appointment':
        return <Calendar className="w-5 h-5 text-blue-500" />;
      case 'medication':
        return <Pill className="w-5 h-5 text-purple-500" />;
      case 'metric':
        return <Activity className="w-5 h-5 text-green-500" />;
      default:
        return null;
    }
  };

  return (
    <button
      onClick={() => onSelect(result)}
      className="w-full text-left px-4 py-3 hover:bg-gray-50 flex items-center space-x-3"
    >
      {getIcon()}
      <div>
        <h4 className="font-medium text-gray-800">{result.title}</h4>
        <p className="text-sm text-gray-500">{result.description}</p>
      </div>
    </button>
  );
};

const Search = () => {
  const { state } = useHealth();
  const [query, setQuery] = useState('');
  const [isOpen, setIsOpen] = useState(false);
  const [results, setResults] = useState([]);
  const searchRef = useRef(null);

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (searchRef.current && !searchRef.current.contains(event.target)) {
        setIsOpen(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => document.removeEventListener('mousedown', handleClickOutside);
  }, []);

  const handleSearch = (searchQuery) => {
    setQuery(searchQuery);
    if (searchQuery.length < 2) {
      setResults([]);
      setIsOpen(false);
      return;
    }

    const searchResults = [
      // Search through appointments
      ...state.appointments
        .filter(app => 
          app.title.toLowerCase().includes(searchQuery.toLowerCase()) ||
          app.doctor.toLowerCase().includes(searchQuery.toLowerCase())
        )
        .map(app => ({
          type: 'appointment',
          title: app.title,
          description: `With ${app.doctor} on ${app.date}`,
          data: app
        })),
      
      // Search through medications
      ...state.medications
        .filter(med => 
          med.name.toLowerCase().includes(searchQuery.toLowerCase())
        )
        .map(med => ({
          type: 'medication',
          title: med.name,
          description: `${med.dosage} â€¢ ${med.frequency}`,
          data: med
        })),
      
      // Search through metrics
      ...Object.entries(state.healthMetrics)
        .filter(([key]) => 
          key.toLowerCase().includes(searchQuery.toLowerCase())
        )
        .map(([key, value]) => ({
          type: 'metric',
          title: key.charAt(0).toUpperCase() + key.slice(1),
          description: `Current: ${value.current}${typeof value.goal !== 'undefined' ? ` / Goal: ${value.goal}` : ''}`,
          data: value
        }))
    ];

    setResults(searchResults);
    setIsOpen(searchResults.length > 0);
  };

  const handleSelect = (result) => {
    // Handle the selection based on the type
    console.log('Selected:', result);
    setIsOpen(false);
    setQuery('');
  };

  return (
    <div ref={searchRef} className="relative">
      <div className="relative">
        <input
          type="text"
          value={query}
          onChange={(e) => handleSearch(e.target.value)}
          placeholder="Search..."
          className="pl-10 pr-4 py-2 border rounded-lg w-64 focus:outline-none focus:ring-2 focus:ring-[#0DBBFC]"
        />
        <SearchIcon className="w-5 h-5 text-gray-400 absolute left-3 top-1/2 transform -translate-y-1/2" />
      </div>

      {isOpen && results.length > 0 && (
        <div className="absolute mt-2 w-96 bg-white rounded-xl shadow-lg border z-50 max-h-96 overflow-y-auto">
          <div className="py-2">
            {results.map((result, index) => (
              <SearchResult
                key={index}
                result={result}
                onSelect={handleSelect}
              />
            ))}
          </div>
        </div>
      )}
    </div>
  );
};

export default Search;
